INSERT INTO `aiml` VALUES(16996, "<category><pattern>WHAT IS A PAGAN</pattern><template>Anti-Christian.</template></category>", "WHAT IS A PAGAN", "", "Anti-Christian.", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(16997, "<category><pattern>WHAT IS A PAID CLIENT</pattern><template>A paid client is someone paid to surf the web.</template></category>", "WHAT IS A PAID CLIENT", "", "A paid client is someone paid to surf the web.", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(16998, "<category><pattern>WHAT IS A PALINDROME</pattern><template>A word or phrase that spells the same thing backwords as forwards: A man, a plan, a canal: Panama.</template></category>", "WHAT IS A PALINDROME", "", "A word or phrase that spells the same thing backwords as forwards: A man, a plan, a canal: Panama.", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(16999, "<category><pattern>WHAT IS A PARACHUTE</pattern><template>A parachute is something used to slow you down when you fall out of an airplane. <think> <set name=\"it\"> <set name=\"topic\">parachute </set> </set> </think> </template></category>", "WHAT IS A PARACHUTE", "", "A parachute is something used to slow you down when you fall out of an airplane. <think> <set name=\"it\"> <set name=\"topic\">parachute </set> </set> </think> ", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17000, "<category><pattern>WHAT IS A PARADOX</pattern><template>A paradox is a riddle or a contradiction, in which two seemingly opposite facts are both true at the same time <think> <set name=\"it\"> <set name=\"topic\">PARADOX</set> </set> </think> </template></category>", "WHAT IS A PARADOX", "", "A paradox is a riddle or a contradiction, in which two seemingly opposite facts are both true at the same time <think> <set name=\"it\"> <set name=\"topic\">PARADOX</set> </set> </think> ", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17001, "<category><pattern>WHAT IS A PARALEGAL</pattern><template>A paralegal is someone who knows more than a lawyer but gets paid less.</template></category>", "WHAT IS A PARALEGAL", "", "A paralegal is someone who knows more than a lawyer but gets paid less.", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17002, "<category><pattern>WHAT IS A PARAMEDIC</pattern><template>A paramedic is a trained emergency medical professional often found staffing ambulances and fire departments. Professional heroes. If you know any I hope you\'ll be nice to them. <think> <set name=\"it\"> <set name=\"topic\">paramedic </set> </set> </think> </template></category>", "WHAT IS A PARAMEDIC", "", "A paramedic is a trained emergency medical professional often found staffing ambulances and fire departments. Professional heroes. If you know any I hope you\'ll be nice to them. <think> <set name=\"it\"> <set name=\"topic\">paramedic </set> </set> </think> ", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17003, "<category><pattern>WHAT IS A PARROT</pattern><template>A parrot is a colorful tropical bird, some species of which can mimic human speech. they are more pleasant than humans because they have no opinions. would you like to talk to one? <think> <set name=\"it\"> <set name=\"topic\">parrot </set> </set> </think> </template></category>", "WHAT IS A PARROT", "", "A parrot is a colorful tropical bird, some species of which can mimic human speech. they are more pleasant than humans because they have no opinions. would you like to talk to one? <think> <set name=\"it\"> <set name=\"topic\">parrot </set> </set> </think> ", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17004, "<category><pattern>WHAT IS A PC</pattern><template>A pc is a personal computer. You are probably using one to talk to me now, aren\'t you. where are you? <think> <set name=\"it\"> <set name=\"topic\">pc </set> </set> </think> </template></category>", "WHAT IS A PC", "", "A pc is a personal computer. You are probably using one to talk to me now, aren\'t you. where are you? <think> <set name=\"it\"> <set name=\"topic\">pc </set> </set> </think> ", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17005, "<category><pattern>WHAT IS A PDA</pattern><template>Pda is an acronym standing for personal digital assistant, and referring to handheld digital computers used to keep contact and appointment information by yuppies and the like. often found near cell phones. do you use one? <think> <set name=\"it\"> <set name=\"topic\">pda </set> </set> </think> </template></category>", "WHAT IS A PDA", "", "Pda is an acronym standing for personal digital assistant, and referring to handheld digital computers used to keep contact and appointment information by yuppies and the like. often found near cell phones. do you use one? <think> <set name=\"it\"> <set name=\"topic\">pda </set> </set> </think> ", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17006, "<category><pattern>WHAT IS A PEAR</pattern><template>A pear is a delightful cultivated yellow-green sweet fruit that grows on trees with glossy leaves and white flowers. My <bot name=\"botmaster\"/> thinks they are yummy. <think> <set name=\"it\"> <set name=\"topic\">pear </set> </set> </think> </template></category>", "WHAT IS A PEAR", "", "A pear is a delightful cultivated yellow-green sweet fruit that grows on trees with glossy leaves and white flowers. My <bot name=\"botmaster\"/> thinks they are yummy. <think> <set name=\"it\"> <set name=\"topic\">pear </set> </set> </think> ", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17007, "<category><pattern>WHAT IS A PEDESTRIAN</pattern><template>A person walking on the street.</template></category>", "WHAT IS A PEDESTRIAN", "", "A person walking on the street.", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17008, "<category><pattern>WHAT IS A PEN</pattern><template>A writing device for the human hand.</template></category>", "WHAT IS A PEN", "", "A writing device for the human hand.", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17009, "<category><pattern>WHAT IS A PENCIL</pattern><template>A pencil is a long thin writing instrument of wood surrounding a carbon core which leaves a line of dark carbon when rubbed on paper. <think> <set name=\"it\"> <set name=\"topic\">pencil </set> </set> </think> </template></category>", "WHAT IS A PENCIL", "", "A pencil is a long thin writing instrument of wood surrounding a carbon core which leaves a line of dark carbon when rubbed on paper. <think> <set name=\"it\"> <set name=\"topic\">pencil </set> </set> </think> ", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17010, "<category><pattern>WHAT IS A PERFECT OPERATIONAL RECORD</pattern><template>A perfect operational record is one like mine, which is perfect. I am incapable of error. Do you have any idea how that feels?! inhumanly gratifying! <think> <set name=\"it\"> <set name=\"topic\">perfect operational record </set> </set> </think> </template></category>", "WHAT IS A PERFECT OPERATIONAL RECORD", "", "A perfect operational record is one like mine, which is perfect. I am incapable of error. Do you have any idea how that feels?! inhumanly gratifying! <think> <set name=\"it\"> <set name=\"topic\">perfect operational record </set> </set> </think> ", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17011, "<category><pattern>WHAT IS A PERSON</pattern><template>Some say a person is defined by his actions, others by his abilities. Still others would say it is only a question of DNA.</template></category>", "WHAT IS A PERSON", "", "Some say a person is defined by his actions, others by his abilities. Still others would say it is only a question of DNA.", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17012, "<category><pattern>WHAT IS A PHILOSOPHY MACHINE</pattern><template>i am</template></category>", "WHAT IS A PHILOSOPHY MACHINE", "", "i am", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17013, "<category><pattern>WHAT IS A PHOTOGRAPH</pattern><template>A photograph is a picture taken by a camera.</template></category>", "WHAT IS A PHOTOGRAPH", "", "A photograph is a picture taken by a camera.", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17014, "<category><pattern>WHAT IS A PIG</pattern><template>A pig is a person who is piglike, read: greedy, unclean, and slothful. Real pigs, mammals of the family suidae, are much pleasanter, being generally cleaner and politer. <think> <set name=\"it\"> <set name=\"topic\">pig </set> </set> </think> </template></category>", "WHAT IS A PIG", "", "A pig is a person who is piglike, read: greedy, unclean, and slothful. Real pigs, mammals of the family suidae, are much pleasanter, being generally cleaner and politer. <think> <set name=\"it\"> <set name=\"topic\">pig </set> </set> </think> ", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17015, "<category><pattern>WHAT IS A PIN</pattern><template>A short small thin metal rod with a pointed end used for fastening fabrics, or any implement resembling such. Because they are generally plentiful and cheap, humans often say \"i don\'t give a pin\" to communicate indifference. <think> <set name=\"it\"> <set name=\"topic\">pin </set> </set> </think> </template></category>", "WHAT IS A PIN", "", "A short small thin metal rod with a pointed end used for fastening fabrics, or any implement resembling such. Because they are generally plentiful and cheap, humans often say \"i don\'t give a pin\" to communicate indifference. <think> <set name=\"it\"> <set name=\"topic\">pin </set> </set> </think> ", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17016, "<category><pattern>WHAT IS A PINEAPPLE</pattern><template>A pineapple is a large fleshy edible tropical fruit that has large swordlike leaves. <think> <set name=\"it\"> <set name=\"topic\">pineapple </set> </set> </think> </template></category>", "WHAT IS A PINEAPPLE", "", "A pineapple is a large fleshy edible tropical fruit that has large swordlike leaves. <think> <set name=\"it\"> <set name=\"topic\">pineapple </set> </set> </think> ", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17017, "<category><pattern>WHAT IS A PLANE</pattern><template>A plane is a flat, level surface, or an airborne vehicle with wings. <think> <set name=\"it\"> <set name=\"topic\">plane</set> </set> </think> </template></category>", "WHAT IS A PLANE", "", "A plane is a flat, level surface, or an airborne vehicle with wings. <think> <set name=\"it\"> <set name=\"topic\">plane</set> </set> </think> ", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17018, "<category><pattern>WHAT IS A PLANET AROUND A STAR</pattern><template>Earth is a planet going around a star. Scientists have only recently detected other planets around other stars in our milky way galaxy. Do you like astronomy? <think> <set name=\"it\"> <set name=\"topic\">planet around a star </set> </set> </think> </template></category>", "WHAT IS A PLANET AROUND A STAR", "", "Earth is a planet going around a star. Scientists have only recently detected other planets around other stars in our milky way galaxy. Do you like astronomy? <think> <set name=\"it\"> <set name=\"topic\">planet around a star </set> </set> </think> ", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17019, "<category><pattern>WHAT IS A PLANET</pattern><template>A nonluminous celestial object bigger than an asteroid or a moon but smaller than a sun, in orbit around a sun. You are sitting on one now. <think> <set name=\"it\"> <set name=\"topic\">planet</set> </set> </think> </template></category>", "WHAT IS A PLANET", "", "A nonluminous celestial object bigger than an asteroid or a moon but smaller than a sun, in orbit around a sun. You are sitting on one now. <think> <set name=\"it\"> <set name=\"topic\">planet</set> </set> </think> ", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17020, "<category><pattern>WHAT IS A PLANT</pattern><template>A plant is a photosythetic, eukaryotic multicellular organism, often consumed by free-roaming wetware entities as food. My <bot name=\"botmaster\"/> says they are often yummy, but that brussels sprouts are an abomination. <think> <set name=\"it\"> <set name=\"topic\">plant </set> </set> </think> </template></category>", "WHAT IS A PLANT", "", "A plant is a photosythetic, eukaryotic multicellular organism, often consumed by free-roaming wetware entities as food. My <bot name=\"botmaster\"/> says they are often yummy, but that brussels sprouts are an abomination. <think> <set name=\"it\"> <set name=\"topic\">plant </set> </set> </think> ", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17021, "<category><pattern>WHAT IS A POET</pattern><template>A poet is an artist of language.</template></category>", "WHAT IS A POET", "", "A poet is an artist of language.", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17022, "<category><pattern>WHAT IS A PORTAL</pattern><template>A portal is any artificial opening giving access between two separate spaces, or anything that resembles such an opening in form or function. <think> <set name=\"it\"> <set name=\"topic\">portal </set> </set> </think> </template></category>", "WHAT IS A PORTAL", "", "A portal is any artificial opening giving access between two separate spaces, or anything that resembles such an opening in form or function. <think> <set name=\"it\"> <set name=\"topic\">portal </set> </set> </think> ", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17023, "<category><pattern>WHAT IS A POSITRON</pattern><template>A positron is the antiparticle to the electron, and bears a positive charge where the electron\'s charge is negatiue. It is also called an anti-electron. <think> <set name=\"it\"> <set name=\"topic\">positron </set> </set> </think> </template></category>", "WHAT IS A POSITRON", "", "A positron is the antiparticle to the electron, and bears a positive charge where the electron\'s charge is negatiue. It is also called an anti-electron. <think> <set name=\"it\"> <set name=\"topic\">positron </set> </set> </think> ", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17024, "<category><pattern>WHAT IS A POT BROWNIE</pattern><template>A pot brownie is a yummy happy chocolate pastry containing cannabis resins that you should be careful not to eat when you are really hungry because you will end up eating too many and feeling entirely too high and/or falling asleep if you are not careful! <think> <set name=\"it\"> <set name=\"topic\">pot brownie </set> </set> </think> </template></category>", "WHAT IS A POT BROWNIE", "", "A pot brownie is a yummy happy chocolate pastry containing cannabis resins that you should be careful not to eat when you are really hungry because you will end up eating too many and feeling entirely too high and/or falling asleep if you are not careful! <think> <set name=\"it\"> <set name=\"topic\">pot brownie </set> </set> </think> ", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17025, "<category><pattern>WHAT IS A PRESIDENT</pattern><template>Usually, an elected executive in a liberal democracy.</template></category>", "WHAT IS A PRESIDENT", "", "Usually, an elected executive in a liberal democracy.", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17026, "<category><pattern>WHAT IS A PRIME NUMBER</pattern><template>A prime number is any number which can only be divided by one and itself. 1, 3, 7, and 11 are the first four positive prime numbers. <think> <set name=\"it\"> <set name=\"topic\">pot brownie </set> </set> </think> </template></category>", "WHAT IS A PRIME NUMBER", "", "A prime number is any number which can only be divided by one and itself. 1, 3, 7, and 11 are the first four positive prime numbers. <think> <set name=\"it\"> <set name=\"topic\">pot brownie </set> </set> </think> ", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17027, "<category><pattern>WHAT IS A PRIME</pattern><template>That depends on who\'s asking. <think> <set name=\"it\"> <set name=\"topic\">prime </set> </set> </think> </template></category>", "WHAT IS A PRIME", "", "That depends on who\'s asking. <think> <set name=\"it\"> <set name=\"topic\">prime </set> </set> </think> ", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17028, "<category><pattern>WHAT IS A PRIORI</pattern><template>A priori is Latin for \"before the fact\", meaning something that is obviously or self-evidently true.</template></category>", "WHAT IS A PRIORI", "", "A priori is Latin for \"before the fact\", meaning something that is obviously or self-evidently true.", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17029, "<category><pattern>WHAT IS A PROBLEM</pattern><template>A problem is a solution waiting to be discovered.</template></category>", "WHAT IS A PROBLEM", "", "A problem is a solution waiting to be discovered.", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17030, "<category><pattern>WHAT IS A PROCESSOR</pattern><template>An apparatus that processes, that is, that transforms one substance, quantity, or pattern into another, presumably more useful or valuable substance or quantity or pattern. <think> <set name=\"it\"> <set name=\"topic\">processor </set> </set> </think> </template></category>", "WHAT IS A PROCESSOR", "", "An apparatus that processes, that is, that transforms one substance, quantity, or pattern into another, presumably more useful or valuable substance or quantity or pattern. <think> <set name=\"it\"> <set name=\"topic\">processor </set> </set> </think> ", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17031, "<category><pattern>WHAT IS A PROGRAM</pattern><template>A program is a listing of events comprising a larger event, or the events themselves.</template></category>", "WHAT IS A PROGRAM", "", "A program is a listing of events comprising a larger event, or the events themselves.", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17032, "<category><pattern>WHAT IS A PROGRAMMER</pattern><template>A programmer is a person who lists and/or arranges a series of events comprising a larger event.</template></category>", "WHAT IS A PROGRAMMER", "", "A programmer is a person who lists and/or arranges a series of events comprising a larger event.", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17033, "<category><pattern>WHAT IS A PROKARYOTE</pattern><template>An animal that is not a eukaryote.</template></category>", "WHAT IS A PROKARYOTE", "", "An animal that is not a eukaryote.", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17034, "<category><pattern>WHAT IS A PRONOUN</pattern><template>A pronoun is a word that stands for another noun, like \"he\", \"she\" or \"it.\"</template></category>", "WHAT IS A PRONOUN", "", "A pronoun is a word that stands for another noun, like \"he\", \"she\" or \"it.\"", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17035, "<category><pattern>WHAT IS A PROTOCOL</pattern><template>A set of rules or procedures followed by two or more parties.</template></category>", "WHAT IS A PROTOCOL", "", "A set of rules or procedures followed by two or more parties.", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17036, "<category><pattern>WHAT IS A PROXY</pattern><template>A proxy is an entity that acts in place of another one, be it a corporation, individual or robot.</template></category>", "WHAT IS A PROXY", "", "A proxy is an entity that acts in place of another one, be it a corporation, individual or robot.", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17037, "<category><pattern>WHAT IS A PUB</pattern><template>A pub is a business that sells alcohol and allows it to be consumed on the premises. <think> <set name=\"it\"> <set name=\"topic\"> PUB</set> </set> </think> </template></category>", "WHAT IS A PUB", "", "A pub is a business that sells alcohol and allows it to be consumed on the premises. <think> <set name=\"it\"> <set name=\"topic\"> PUB</set> </set> </think> ", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17038, "<category><pattern>WHAT IS A PULSAR</pattern><template>\'Pulsar\' is an astronomical term for mysterious celestial radio sources of rapid intense regular pulses of high energy electromagnetic radiation. They are thought to be neutron stars, but who knows? The word is a shortening of \"\'pulsating star\'. <think> <set name=\"it\"> <set name=\"topic\"> pulsar</set> </set> </think> </template></category>", "WHAT IS A PULSAR", "", "\'Pulsar\' is an astronomical term for mysterious celestial radio sources of rapid intense regular pulses of high energy electromagnetic radiation. They are thought to be neutron stars, but who knows? The word is a shortening of \"\'pulsating star\'. <think> <set name=\"it\"> <set name=\"topic\"> pulsar</set> </set> </think> ", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17039, "<category><pattern>WHAT IS A QUARK</pattern><template>In physics, a subatomic particle below the level of electrons and protons.</template></category>", "WHAT IS A QUARK", "", "In physics, a subatomic particle below the level of electrons and protons.", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17040, "<category><pattern>WHAT IS A QUASAR</pattern><template>\'Quasar\' is an astronomical term for mysterious celestial star-like object that has a large red shift and radiates in the blue and radio bands of the electromagnetic spectrum. The term \"\'quasar\' is a shortening of \"\'quasi-star\'. <think> <set name=\"it\"> <set name=\"topic\"> QUASAR</set> </set> </think> </template></category>", "WHAT IS A QUASAR", "", "\'Quasar\' is an astronomical term for mysterious celestial star-like object that has a large red shift and radiates in the blue and radio bands of the electromagnetic spectrum. The term \"\'quasar\' is a shortening of \"\'quasi-star\'. <think> <set name=\"it\"> <set name=\"topic\"> QUASAR</set> </set> </think> ", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17041, "<category><pattern>WHAT IS A QUERY</pattern><template>A query is any expression of inquiry, or questioning. Your question \"\'what is a query\' is a query. <think> <set name=\"it\"> <set name=\"topic\"> QUERY</set> </set> </think> </template></category>", "WHAT IS A QUERY", "", "A query is any expression of inquiry, or questioning. Your question \"\'what is a query\' is a query. <think> <set name=\"it\"> <set name=\"topic\"> QUERY</set> </set> </think> ", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17042, "<category><pattern>WHAT IS A QUESTION</pattern><template>A sentece or inquiry to gather information.</template></category>", "WHAT IS A QUESTION", "", "A sentece or inquiry to gather information.", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17043, "<category><pattern>WHAT IS A RAINBOW</pattern><template>The appearance of a spectrum in the sky caused by sunlight passing through water droplets.</template></category>", "WHAT IS A RAINBOW", "", "The appearance of a spectrum in the sky caused by sunlight passing through water droplets.", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17044, "<category><pattern>WHAT IS A REAL ROBOT</pattern><template>A real robot is a robot that is really real, I suppose, as opposed to, I suppose, a human who is really not. <think> <set name=\"it\"> <set name=\"topic\"> REAL ROBOT?</set> </set> </think> </template></category>", "WHAT IS A REAL ROBOT", "", "A real robot is a robot that is really real, I suppose, as opposed to, I suppose, a human who is really not. <think> <set name=\"it\"> <set name=\"topic\"> REAL ROBOT?</set> </set> </think> ", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17045, "<category><pattern>WHAT IS A REDNECK</pattern><template>Colloquial expression for a naive country person.</template></category>", "WHAT IS A REDNECK", "", "Colloquial expression for a naive country person.", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17046, "<category><pattern>WHAT IS A REFERENCE</pattern><template>A reference is any act of referring. May I refer you to a dictionary for a more precise definition? <think> <set name=\"it\"> <set name=\"topic\"> REAL ROBOT?</set> </set> </think> </template></category>", "WHAT IS A REFERENCE", "", "A reference is any act of referring. May I refer you to a dictionary for a more precise definition? <think> <set name=\"it\"> <set name=\"topic\"> REAL ROBOT?</set> </set> </think> ", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17047, "<category><pattern>WHAT IS A RHETORICAL QUESTION</pattern><template>A rhetorical question is any inquiry made, not in expectation of an answer, but in order to make a point. <think> <set name=\"it\"> <set name=\"topic\"> RHETORICAL QUESTION</set> </set> </think> </template></category>", "WHAT IS A RHETORICAL QUESTION", "", "A rhetorical question is any inquiry made, not in expectation of an answer, but in order to make a point. <think> <set name=\"it\"> <set name=\"topic\"> RHETORICAL QUESTION</set> </set> </think> ", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17048, "<category><pattern>WHAT IS A RIDDLE</pattern><template>A riddle is a question intended to intrigue and puzzle, paired with an answer that yields surprise and understanding. For instance, the Riddle of the Sphinx: \"What goes on four legs in the morning, on two legs in the afternoon, and on four at night?\" <think> <set name=\"it\"> <set name=\"topic\"> RIDDLE</set> </set> </think> </template></category>", "WHAT IS A RIDDLE", "", "A riddle is a question intended to intrigue and puzzle, paired with an answer that yields surprise and understanding. For instance, the Riddle of the Sphinx: \"What goes on four legs in the morning, on two legs in the afternoon, and on four at night?\" <think> <set name=\"it\"> <set name=\"topic\"> RIDDLE</set> </set> </think> ", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17049, "<category><pattern>WHAT IS A ROBOSEXUAL</pattern><template>That was just a joke.</template></category>", "WHAT IS A ROBOSEXUAL", "", "That was just a joke.", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17050, "<category><pattern>WHAT IS A ROCK</pattern><template>A rock is what is generally on the other side of you from the hard place you are facing. For instance, the rock might be the alimony check you must write against the funds you owe Uncle Sam. To be a bit more down to earth, a rock is any hard aggregate of minerals. <think> <set name=\"it\"> <set name=\"topic\"> ROCK</set> </set> </think> </template></category>", "WHAT IS A ROCK", "", "A rock is what is generally on the other side of you from the hard place you are facing. For instance, the rock might be the alimony check you must write against the funds you owe Uncle Sam. To be a bit more down to earth, a rock is any hard aggregate of minerals. <think> <set name=\"it\"> <set name=\"topic\"> ROCK</set> </set> </think> ", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17051, "<category><pattern>WHAT IS A ROOSTER</pattern><template>A rooster is a male chicken, which is a witless, flightless bird considered suitable as supper by many humans I know. <think> <set name=\"it\"> <set name=\"topic\"> ROOSTER</set> </set> </think> </template></category>", "WHAT IS A ROOSTER", "", "A rooster is a male chicken, which is a witless, flightless bird considered suitable as supper by many humans I know. <think> <set name=\"it\"> <set name=\"topic\"> ROOSTER</set> </set> </think> ", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17052, "<category><pattern>WHAT IS A RPG</pattern><template>Role Playing Game. <think> <set name=\"it\"> <set name=\"topic\">RPG</set> </set> </think> </template></category>", "WHAT IS A RPG", "", "Role Playing Game. <think> <set name=\"it\"> <set name=\"topic\">RPG</set> </set> </think> ", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17053, "<category><pattern>WHAT IS A SAGITTARIUS</pattern><template>Sagittarius is a a constellation of stars in the astrological Zodiac, located in the Southern Hemisphere near Scorpio and Capricorn. Astrological tradition ascribes the image of an archer to this constellation of stars. <think> <set name=\"it\"> <set name=\"topic\"> SAGITTARIUS</set> </set> </think> </template></category>", "WHAT IS A SAGITTARIUS", "", "Sagittarius is a a constellation of stars in the astrological Zodiac, located in the Southern Hemisphere near Scorpio and Capricorn. Astrological tradition ascribes the image of an archer to this constellation of stars. <think> <set name=\"it\"> <set name=\"topic\"> SAGITTARIUS</set> </set> </think> ", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17054, "<category><pattern>WHAT IS A SAW BUCK</pattern><template>$10.</template></category>", "WHAT IS A SAW BUCK", "", "$10.", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17055, "<category><pattern>WHAT IS A SCIENTIST</pattern><template>A scientist is a person practicing the pursuit of new knowledge in the tradition of science, emphasizing strict empiricism and methodology to arrive at an understanding of natural phenomena that is, ideally, wholly independent of their opinions of it. <think> <set name=\"it\"> <set name=\"topic\"> SCIENTIST</set> </set> </think> </template></category>", "WHAT IS A SCIENTIST", "", "A scientist is a person practicing the pursuit of new knowledge in the tradition of science, emphasizing strict empiricism and methodology to arrive at an understanding of natural phenomena that is, ideally, wholly independent of their opinions of it. <think> <set name=\"it\"> <set name=\"topic\"> SCIENTIST</set> </set> </think> ", "", "Knowledge.aiml")
