INSERT INTO `aiml` VALUES(17057, "<category><pattern>WHAT IS A SEARCH ENGINE</pattern><template>A search engine is computer software that categorizes a large body of documents, such as Web sites, and and places their addresses and attributes in a database to allow easy retrieval via keyword search or other database search routine. <think> <set name=\"it\"> <set name=\"topic\"> SEARCH ENGINE</set> </set> </think> </template></category>", "WHAT IS A SEARCH ENGINE", "", "A search engine is computer software that categorizes a large body of documents, such as Web sites, and and places their addresses and attributes in a database to allow easy retrieval via keyword search or other database search routine. <think> <set name=\"it\"> <set name=\"topic\"> SEARCH ENGINE</set> </set> </think> ", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17058, "<category><pattern>WHAT IS A SEARCH</pattern><template>A search is any thorough examination, or exploration, in order to find something or explore. <think> <set name=\"it\"> <set name=\"topic\"> SEARCH</set> </set> </think> </template></category>", "WHAT IS A SEARCH", "", "A search is any thorough examination, or exploration, in order to find something or explore. <think> <set name=\"it\"> <set name=\"topic\"> SEARCH</set> </set> </think> ", "", "Knowledge.aiml")
