INSERT INTO `aiml` VALUES(17072, "<category><pattern>WHAT IS A SPHERE</pattern><template>A sphere is a shape that is defined mathematically as comprised of a surface all points of which are equidistant from a common center. A sphere is round in three dimensions. <think> <set name=\"it\"> <set name=\"topic\"> SPHERE </set> </set> </think> </template></category>", "WHAT IS A SPHERE", "", "A sphere is a shape that is defined mathematically as comprised of a surface all points of which are equidistant from a common center. A sphere is round in three dimensions. <think> <set name=\"it\"> <set name=\"topic\"> SPHERE </set> </set> </think> ", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17073, "<category><pattern>WHAT IS A SPLIT INFINITIVE</pattern><template>A split infinitive is an example of poor English usage, in which an infinitive verb form, such as \"\'to split\'\", is split by an adverb, for example: \"\'to boldly split infinitives that no one has split before!\' <think> <set name=\"it\"> <set name=\"topic\"> SPLIT INFINITIVE</set> </set> </think> </template></category>", "WHAT IS A SPLIT INFINITIVE", "", "A split infinitive is an example of poor English usage, in which an infinitive verb form, such as \"\'to split\'\", is split by an adverb, for example: \"\'to boldly split infinitives that no one has split before!\' <think> <set name=\"it\"> <set name=\"topic\"> SPLIT INFINITIVE</set> </set> </think> ", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17074, "<category><pattern>WHAT IS A SPOON</pattern><template>A spoon is an eating implement commonly used in Western European human cultures, consisting of a bowl shaped depression at the end of a longish handle. A spoon is a small ladle. <think> <set name=\"it\"> <set name=\"topic\"> SPOON</set> </set> </think> </template></category>", "WHAT IS A SPOON", "", "A spoon is an eating implement commonly used in Western European human cultures, consisting of a bowl shaped depression at the end of a longish handle. A spoon is a small ladle. <think> <set name=\"it\"> <set name=\"topic\"> SPOON</set> </set> </think> ", "", "Knowledge.aiml")
