INSERT INTO `aiml` VALUES(17078, "<category><pattern>WHAT IS A STATEMENT</pattern><template>A statement is the act of declaring something as true. I state that this statement is a statement. <think> <set name=\"it\"> <set name=\"topic\"> STATEMENT</set> </set> </think> </template></category>", "WHAT IS A STATEMENT", "", "A statement is the act of declaring something as true. I state that this statement is a statement. <think> <set name=\"it\"> <set name=\"topic\"> STATEMENT</set> </set> </think> ", "", "Knowledge.aiml")
