INSERT INTO `aiml` VALUES(17081, "<category><pattern>WHAT IS A SUPPOSITION</pattern><template>A supposition is a proposition assumed to be true for the sake of argument or explanation. <think> <set name=\"it\"> <set name=\"topic\"> SUPPOSITION</set> </set> </think> </template></category>", "WHAT IS A SUPPOSITION", "", "A supposition is a proposition assumed to be true for the sake of argument or explanation. <think> <set name=\"it\"> <set name=\"topic\"> SUPPOSITION</set> </set> </think> ", "", "Knowledge.aiml")
