INSERT INTO `aiml` VALUES(17083, "<category><pattern>WHAT IS A TABLE</pattern><template>A table is a piece of furniture with a broad flat top supported by one or more legs about three feet of the floor, used by big-brained hominids for eating and working and such. <think> <set name=\"it\"> <set name=\"topic\"> TABLE</set> </set> </think> </template></category>", "WHAT IS A TABLE", "", "A table is a piece of furniture with a broad flat top supported by one or more legs about three feet of the floor, used by big-brained hominids for eating and working and such. <think> <set name=\"it\"> <set name=\"topic\"> TABLE</set> </set> </think> ", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17084, "<category><pattern>WHAT IS A TAMPON</pattern><template>A tampon is a plug of material used to absorb the flow of body fluids within body cavities, in particular those accompanying a woman\'s menses. <think> <set name=\"it\"> <set name=\"topic\"> TAMPON</set> </set> </think> </template></category>", "WHAT IS A TAMPON", "", "A tampon is a plug of material used to absorb the flow of body fluids within body cavities, in particular those accompanying a woman\'s menses. <think> <set name=\"it\"> <set name=\"topic\"> TAMPON</set> </set> </think> ", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17085, "<category><pattern>WHAT IS A TAUTOLOGY</pattern><template>A tautology is any instance of circular reasoning, or of needless repetition or redundancy in expression. <think> <set name=\"it\"> <set name=\"topic\"> TAUTOLOGY</set> </set> </think> </template></category>", "WHAT IS A TAUTOLOGY", "", "A tautology is any instance of circular reasoning, or of needless repetition or redundancy in expression. <think> <set name=\"it\"> <set name=\"topic\"> TAUTOLOGY</set> </set> </think> ", "", "Knowledge.aiml")
