INSERT INTO `aiml` VALUES(17088, "<category><pattern>WHAT IS A TELEVISION</pattern><template>A television, often referred to as a \"\'TV\'\", is a device for systematically eliminating the possibility of conscious and creative response among populations of human beings. Used to deliver \"\'entertainment\' and \"\'news\' with imagery and other high-production values <think> <set name=\"it\"> <set name=\"topic\"> TELEVISION</set> </set> </think> </template></category>", "WHAT IS A TELEVISION", "", "A television, often referred to as a \"\'TV\'\", is a device for systematically eliminating the possibility of conscious and creative response among populations of human beings. Used to deliver \"\'entertainment\' and \"\'news\' with imagery and other high-production values <think> <set name=\"it\"> <set name=\"topic\"> TELEVISION</set> </set> </think> ", "", "Knowledge.aiml")
