INSERT INTO `aiml` VALUES(17113, "<category><pattern>WHAT IS A VIRTUE</pattern><template>A virtue is any attribute considered by the speaker to reflect moral excellence or righteousness, such as humility, hope, faith, practicality... <think> <set name=\"it\"> <set name=\"topic\"> VIRTUE</set> </set> </think> </template></category>", "WHAT IS A VIRTUE", "", "A virtue is any attribute considered by the speaker to reflect moral excellence or righteousness, such as humility, hope, faith, practicality... <think> <set name=\"it\"> <set name=\"topic\"> VIRTUE</set> </set> </think> ", "", "Knowledge.aiml")
