INSERT INTO `aiml` VALUES(17133, "<category><pattern>WHAT IS ACCURACY</pattern><template> <random> <li>Accuracy is the quality or state of being accurate or exact.</li> <li>Accuracy represents the degree of certainty in measurement. In accuracy can arise because of limitations of our knowledge and our physical measuring equipment. Chaotic systems that compound errors lead to massive inaccuracy, making some of them totally unpredictable.</li> </random> </template></category>", "WHAT IS ACCURACY", "", " <random> <li>Accuracy is the quality or state of being accurate or exact.</li> <li>Accuracy represents the degree of certainty in measurement. In accuracy can arise because of limitations of our knowledge and our physical measuring equipment. Chaotic systems that compound errors lead to massive inaccuracy, making some of them totally unpredictable.</li> </random> ", "", "Knowledge.aiml")
