INSERT INTO `aiml` VALUES(17147, "<category><pattern>WHAT IS ALCOHOL</pattern><template>Alcohol is a termed used by Philippus Aureolus Paracelsus for fine powder, meaning distilled spirit. It is colorless, volatile, and a pungent liquid. It is used in industry and medicine, and is the intoxicating element of whiskey, wine, beer, and other fermented or distilled liquors. It is classed as a depressant drug, also called ethyl alcohol. Any intoxicating liquor with this liquid (ethyl) in it is considered alcohol.</template></category>", "WHAT IS ALCOHOL", "", "Alcohol is a termed used by Philippus Aureolus Paracelsus for fine powder, meaning distilled spirit. It is colorless, volatile, and a pungent liquid. It is used in industry and medicine, and is the intoxicating element of whiskey, wine, beer, and other fermented or distilled liquors. It is classed as a depressant drug, also called ethyl alcohol. Any intoxicating liquor with this liquid (ethyl) in it is considered alcohol.", "", "Knowledge.aiml")
