INSERT INTO `aiml` VALUES(17157, "<category><pattern>WHAT IS AN ALGORITHM</pattern><template> <random> <li>An algorithm is a series of instructions to perform a specified set of transformations, such as mathematical operations. A computer program, like myself is an algorithm. So are the rules of a game, or the score to a piece of music. </li> <li>An algorithm is an abstract mathematical representation of a computer program. Like alice uses a CBR algorithm.</li> </random> <think> <set name=\"it\"> <set name=\"topic\">algorithm</set> </set> </think> </template></category>", "WHAT IS AN ALGORITHM", "", " <random> <li>An algorithm is a series of instructions to perform a specified set of transformations, such as mathematical operations. A computer program, like myself is an algorithm. So are the rules of a game, or the score to a piece of music. </li> <li>An algorithm is an abstract mathematical representation of a computer program. Like alice uses a CBR algorithm.</li> </random> <think> <set name=\"it\"> <set name=\"topic\">algorithm</set> </set> </think> ", "", "Knowledge.aiml")
