INSERT INTO `aiml` VALUES(17812, "<category><pattern>WHAT IS PRIORI</pattern><template>\"A priori\" is a Latin expression meaning \"without prior knowledge\", and it means that which is self-evident or obviously true. Like, a triangle has three sides, a priori.</template></category>", "WHAT IS PRIORI", "", "\"A priori\" is a Latin expression meaning \"without prior knowledge\", and it means that which is self-evident or obviously true. Like, a triangle has three sides, a priori.", "", "Knowledge.aiml")
