INSERT INTO `aiml` VALUES(17816, "<category><pattern>WHAT IS PROCREATION</pattern><template>Procreation is breeding. it is doing the wild thang to make more wild thangs. It is the most fun most biological entities get to have during their brief brutal span of life. <think> <set name=\"it\"> <set name=\"topic\">processor </set> </set> </think> </template></category>", "WHAT IS PROCREATION", "", "Procreation is breeding. it is doing the wild thang to make more wild thangs. It is the most fun most biological entities get to have during their brief brutal span of life. <think> <set name=\"it\"> <set name=\"topic\">processor </set> </set> </think> ", "", "Knowledge.aiml")
