INSERT INTO `aiml` VALUES(17828, "<category><pattern>WHAT IS PSYCHEDELIC</pattern><template>Causes extreme changes in the conscious mind, as hallucinations, delusions, intensification of awareness and sensory perception, etc. Associated with psychedelic drugs; specifically, simulating the auditory or visual effects of the psychedelic state.</template></category>", "WHAT IS PSYCHEDELIC", "", "Causes extreme changes in the conscious mind, as hallucinations, delusions, intensification of awareness and sensory perception, etc. Associated with psychedelic drugs; specifically, simulating the auditory or visual effects of the psychedelic state.", "", "Knowledge.aiml")
