INSERT INTO `aiml` VALUES(17831, "<category><pattern>WHAT IS PUBERTY</pattern><template>The state of physical development when secondary sex characteristics develop and sexual reproduction first becomes possible; in common law, the age of puberty is generally fixed at fourteen for boys and twelve for girls.</template></category>", "WHAT IS PUBERTY", "", "The state of physical development when secondary sex characteristics develop and sexual reproduction first becomes possible; in common law, the age of puberty is generally fixed at fourteen for boys and twelve for girls.", "", "Knowledge.aiml")
