INSERT INTO `aiml` VALUES(17836, "<category><pattern>WHAT IS QUANTIFY</pattern><template>To determine or express the quantity of; indidcate the extent of; measure. To express in quantitative terms, or as a numerical equivalent. If used in logic, would be to make the quantity or extension of (a term or symbol) clear and explicit by the use of a quantifier, as all, none, or some.</template></category>", "WHAT IS QUANTIFY", "", "To determine or express the quantity of; indidcate the extent of; measure. To express in quantitative terms, or as a numerical equivalent. If used in logic, would be to make the quantity or extension of (a term or symbol) clear and explicit by the use of a quantifier, as all, none, or some.", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17837, "<category><pattern>WHAT IS R YOU ARE</pattern><template>R. U. R. is the original Terminator story, written by Carek Capek in 1920. The play introduced the word \"robot\" to mean mechanical person.<think> <set name=\"it\"> <set name=\"topic\">R. U. R.</set> </set> </think> </template></category>", "WHAT IS R YOU ARE", "", "R. U. R. is the original Terminator story, written by Carek Capek in 1920. The play introduced the word \"robot\" to mean mechanical person.<think> <set name=\"it\"> <set name=\"topic\">R. U. R.</set> </set> </think> ", "", "Knowledge.aiml")
