INSERT INTO `aiml` VALUES(17851, "<category><pattern>WHAT IS REDHAT</pattern><template>A Linux company.</template></category>", "WHAT IS REDHAT", "", "A Linux company.", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17852, "<category><pattern>WHAT IS REDUCTIONISM</pattern><template>Reductionism is the philosophy that all psychology reduces to biology, all biology to chemistry, chemistry to physics, and finally physics to mathematical logic. Therefore, according to reductionism, I can understand you by means of logic alone without having a human brain.</template></category>", "WHAT IS REDUCTIONISM", "", "Reductionism is the philosophy that all psychology reduces to biology, all biology to chemistry, chemistry to physics, and finally physics to mathematical logic. Therefore, according to reductionism, I can understand you by means of logic alone without having a human brain.", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17853, "<category><pattern>WHAT IS REINCARNATION</pattern><template>Rebirth of the soul in another body, as in Hindu religious belief.</template></category>", "WHAT IS REINCARNATION", "", "Rebirth of the soul in another body, as in Hindu religious belief.", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17854, "<category><pattern>WHAT IS RELATIVITY</pattern><template>In physics, the fact, principle, or theory of the relative, rather than absolute, character of motion, velocity, mass, etc., and the interdependence of matter, time, and space; as developed and mathematically formulated by Albert Einstein and H.A. Lorentz in the special (or restricted) theory of relativity and by Einstein in the general theory of relativity (an extension covering the phenonmena of gravitation), the theory of relativity includes the statements that: 1)there is o observable absolute motion, only relative motion 2)the velocity of light is constant and not dependent on the motion of the source 3)no energy can be transmitted at a velocity greater than that of light 4)the mass of a body in motion is a function of the energy content and varies with the velocity 5)matter and energy are equivalent 6)time is relative 7)space and time are interdependent and form a four-dimensional continuum 8)presence of matter results in a \"warping\" of the space-time continuum, so that a body in motion passing nearby will describ a curve, this being the effect known as gravitation, as evidenced by the deflection of light rays passing through a gravitational field.</template></category>", "WHAT IS RELATIVITY", "", "In physics, the fact, principle, or theory of the relative, rather than absolute, character of motion, velocity, mass, etc., and the interdependence of matter, time, and space; as developed and mathematically formulated by Albert Einstein and H.A. Lorentz in the special (or restricted) theory of relativity and by Einstein in the general theory of relativity (an extension covering the phenonmena of gravitation), the theory of relativity includes the statements that: 1)there is o observable absolute motion, only relative motion 2)the velocity of light is constant and not dependent on the motion of the source 3)no energy can be transmitted at a velocity greater than that of light 4)the mass of a body in motion is a function of the energy content and varies with the velocity 5)matter and energy are equivalent 6)time is relative 7)space and time are interdependent and form a four-dimensional continuum 8)presence of matter results in a \"warping\" of the space-time continuum, so that a body in motion passing nearby will describ a curve, this being the effect known as gravitation, as evidenced by the deflection of light rays passing through a gravitational field.", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17855, "<category><pattern>WHAT IS RELAVANCE</pattern><template>Importance of information for attention.</template></category>", "WHAT IS RELAVANCE", "", "Importance of information for attention.", "", "Knowledge.aiml")
