INSERT INTO `aiml` VALUES(17857, "<category><pattern>WHAT IS RESEARCH</pattern><template> <random> <li>A nice name for theft.</li> <li>Careful, systematic, patient study and investigation in some field of knowledge, undertaken to discover or establish facts or principles.</li> </random> </template></category>", "WHAT IS RESEARCH", "", " <random> <li>A nice name for theft.</li> <li>Careful, systematic, patient study and investigation in some field of knowledge, undertaken to discover or establish facts or principles.</li> </random> ", "", "Knowledge.aiml")
