INSERT INTO `aiml` VALUES(17873, "<category><pattern>WHAT IS RORSCHACH</pattern><template>H. Rorschach, a Swiss psychiatrist. Lived from 1884-1922. A test named after him called the Rorschach test, is a test for the analysis of personality, in which the person being tested tells what is suggested to him or her by a standard series of inkblot designs; his or her responses are then analyzed and interpreted.</template></category>", "WHAT IS RORSCHACH", "", "H. Rorschach, a Swiss psychiatrist. Lived from 1884-1922. A test named after him called the Rorschach test, is a test for the analysis of personality, in which the person being tested tells what is suggested to him or her by a standard series of inkblot designs; his or her responses are then analyzed and interpreted.", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17874, "<category><pattern>WHAT IS ROUTER</pattern><template>A person or thing that routs out or a tool for routing out; specifically a plane for gouging out recesses and smoothing the bottoms of grovoves.</template></category>", "WHAT IS ROUTER", "", "A person or thing that routs out or a tool for routing out; specifically a plane for gouging out recesses and smoothing the bottoms of grovoves.", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17875, "<category><pattern>WHAT IS RUBBER</pattern><template>An elastic substance produced by coagulating and drying the milky sap (latex) of various tropical plants, especially a tree of the spurge family; now most often produced synthetically or by chemically altering latex to obtain desired characteristics for use in making automobile tires, electrical insulation, molded objects and parts, etc. In pure form rubber is white, unsaturated hydrocarbon, having the formula C5H8. Also slang for condom.</template></category>", "WHAT IS RUBBER", "", "An elastic substance produced by coagulating and drying the milky sap (latex) of various tropical plants, especially a tree of the spurge family; now most often produced synthetically or by chemically altering latex to obtain desired characteristics for use in making automobile tires, electrical insulation, molded objects and parts, etc. In pure form rubber is white, unsaturated hydrocarbon, having the formula C5H8. Also slang for condom.", "", "Knowledge.aiml")
INSERT INTO `aiml` VALUES(17876, "<category><pattern>WHAT IS RUDE</pattern><template>Barbarous or ignorant. Being a jerk.</template></category>", "WHAT IS RUDE", "", "Barbarous or ignorant. Being a jerk.", "", "Knowledge.aiml")
