INSERT INTO `aiml` VALUES(17878, "<category><pattern>WHAT IS RUSSIA</pattern><template>Former empire in east Europe and north Asia, from 1547-1917, ruled by the czars. Its capital is St. Petersburg.</template></category>", "WHAT IS RUSSIA", "", "Former empire in east Europe and north Asia, from 1547-1917, ruled by the czars. Its capital is St. Petersburg.", "", "Knowledge.aiml")
